// Google Custom Search API Service
// Fetches real images from Google search results based on address

class GoogleSearchService {
  constructor() {
    this.apiKey = process.env.REACT_APP_GOOGLE_SEARCH_API_KEY;
    this.searchEngineId = process.env.REACT_APP_GOOGLE_SEARCH_ENGINE_ID;
    this.baseUrl = 'https://www.googleapis.com/customsearch/v1';
  }

  // Check if service is properly configured
  isConfigured() {
    return this.apiKey && this.searchEngineId;
  }

  // Get configuration status
  getConfigStatus() {
    return {
      hasApiKey: !!this.apiKey,
      hasSearchEngineId: !!this.searchEngineId,
      isConfigured: this.isConfigured()
    };
  }

  // Search for images using Google Custom Search
  async searchImages(query, count = 5) {
    if (!this.isConfigured()) {
      console.warn('Google Search API not configured. Please set REACT_APP_GOOGLE_SEARCH_API_KEY and REACT_APP_GOOGLE_SEARCH_ENGINE_ID');
      return null;
    }

    try {
      const searchUrl = `${this.baseUrl}?key=${this.apiKey}&cx=${this.searchEngineId}&q=${encodeURIComponent(query)}&searchType=image&num=${count}&safe=active`;
      
      console.log('Searching Google for:', query);
      const response = await fetch(searchUrl);
      
      if (!response.ok) {
        throw new Error(`Google Search API error: ${response.status} ${response.statusText}`);
      }
      
      const data = await response.json();
      
      if (data.items && data.items.length > 0) {
        // Filter out irrelevant images (cannabis, adult content, etc.)
        const filteredImages = data.items.filter(item => {
          const title = item.title?.toLowerCase() || '';
          const context = item.image?.contextLink?.toLowerCase() || '';
          
          // Filter out unwanted content
          const unwantedKeywords = [
            'cannabis', 'marijuana', 'weed', 'drug', 'adult', 'porn', 'xxx',
            'gambling', 'casino', 'betting', 'scam', 'fake', 'spam'
          ];
          
          const hasUnwantedContent = unwantedKeywords.some(keyword => 
            title.includes(keyword) || context.includes(keyword)
          );
          
          return !hasUnwantedContent;
        });
        
        if (filteredImages.length > 0) {
          const images = filteredImages.map(item => ({
            url: item.link,
            thumbnail: item.image?.thumbnailLink,
            title: item.title,
            context: item.image?.contextLink
          }));
          
          console.log(`Found ${filteredImages.length} relevant images for query: ${query}`);
          return images;
        } else {
          console.log(`All images filtered out for query: ${query}`);
          return null;
        }
      }
      
      console.log(`No images found for query: ${query}`);
      return null;
      
    } catch (error) {
      console.error('Google Search API error:', error);
      return null;
    }
  }

  // Get the best image for a property address
  async getPropertyImage(address, propertyType = '') {
    try {
      // Create multiple search queries for better results - more specific and relevant
      const queries = [
        `${address} Singapore building exterior`,         // Most specific - exact address + building
        `${propertyType} ${address} Singapore`,           // Property type + address + location
        `${address} property exterior`,                   // Address + property + exterior
        `${propertyType} Singapore ${address}`,           // Property type + location + address
        `${propertyType} Singapore industrial building`,  // Generic fallback - property type + location
      ];

      // Try each query until we find images
      for (const query of queries) {
        console.log(`Trying query: ${query}`);
        const images = await this.searchImages(query, 3);
        
        if (images && images.length > 0) {
          // Return the first (best) image
          const bestImage = images[0];
          console.log(`Found image for ${address}:`, bestImage.url);
          return bestImage.url;
        }
      }
      
      console.log(`No images found for any query for address: ${address}`);
      return null;
      
    } catch (error) {
      console.error('Error getting property image:', error);
      return null;
    }
  }

  // Get comparison image for two addresses
  async getComparisonImage(address1, address2) {
    try {
      // Try to get image for first address
      let imageUrl = await this.getPropertyImage(address1);
      if (imageUrl) {
        return imageUrl;
      }
      
      // Fallback to second address
      imageUrl = await this.getPropertyImage(address2);
      if (imageUrl) {
        return imageUrl;
      }
      
      // Final fallback to generic search
      const images = await this.searchImages('Singapore industrial property building', 1);
      return images?.[0]?.url || null;
      
    } catch (error) {
      console.error('Error getting comparison image:', error);
      return null;
    }
  }

  // Get multiple images for a property (for galleries)
  async getPropertyImages(address, propertyType = '', count = 5) {
    try {
      const query = `${propertyType} ${address} building`;
      return await this.searchImages(query, count);
    } catch (error) {
      console.error('Error getting property images:', error);
      return null;
    }
  }

  // Test the service
  async test() {
    try {
      console.log('Testing Google Search Service...');
      const configStatus = this.getConfigStatus();
      console.log('Configuration status:', configStatus);
      
      if (!this.isConfigured()) {
        console.warn('Service not configured - cannot test');
        return false;
      }
      
      const testResult = await this.searchImages('Singapore industrial building', 1);
      if (testResult && testResult.length > 0) {
        console.log('✅ Google Search Service test successful:', testResult[0].url);
        return true;
      } else {
        console.log('❌ Google Search Service test failed - no results');
        return false;
      }
      
    } catch (error) {
      console.error('❌ Google Search Service test failed:', error);
      return false;
    }
  }
}

export default GoogleSearchService;
